    //     _listings[tokenId][msg.sender].status = 0x00;
    // }

    // function putDropOfTheDayItemOnHold(uint256 tokenId) external {
    //     require(
    //         hasRole(DROP_OF_THE_DAY_CREATOR_ROLE, msg.sender),
    //         "Put drop of the day item on hold: caller is not drop of the day creator."
    //     );
