    //     require(
    //         !_listings[tokenId][msg.sender].isDropOfTheDay,
    //         "Put drop of the day item on hold: cannot put drop of the day item on hold."
    //     );
    //     require(
    //         _listings[tokenId][msg.sender].highestBidder == address(0),
    //         "Put drop of the day item on hold: cannot put on hold as bid exists."
    //     );
    //     require(
    //         _listings[tokenId][msg.sender].startTime > block.timestamp ||
    //             _listings[tokenId][msg.sender].endTime < block.timestamp,
    //         "Put drop of the day item on hold: cannot put on hold during auction."
    //     );

    //     _listings[tokenId][msg.sender].status = 0x00;
    // }

    function setDropOfTheDayAuctionEndTime(uint256 tokenId, uint256 newEndTime)
        external
    {
        require(
            hasRole(DROP_OF_THE_DAY_CREATOR_ROLE, msg.sender),
            "Set drop of the day auction end time: caller is not drop of the day creator."
        );
        require(
            block.timestamp < _listings[tokenId][msg.sender].endTime,
            "Set drop of the day auction end time: auction ended."
        );
        _listings[tokenId][msg.sender].endTime = newEndTime;
    }
}

